  "bird",
 )
}

func printAll[I int, S string](
 i I,
 s string,
) {
 fmt.Println(i)
 fmt.Println(s)
}' The printAll function has two type parameters 'I' and 'S' but uses only the first of them. Therefore, the 'S string' is grayed out.

